static const std::array<ImWchar, 10> icons_ranges = {
    0x02194, 0x02B1B,
    0x0E000, 0x0E011,
    0x0FF10, 0x0FF3A,
    //0x1F3A7, 0x1F6D2,
    0, 0 };

void PF_BuildAtlas(struct ImFontAtlas* atlas, bool merge)
{
    atlas->AddFontDefault();

    ImFontConfig font_cfg;
    font_cfg.MergeMode = merge;
    font_cfg.GlyphRanges = icons_ranges.data();
    //font_cfg.GlyphOffset = ImVec2(-1, 3);
    atlas->AddFontFromMemoryCompressedBase85TTF(promptfont_ttf_compressed_data_base85, 26, &font_cfg);
}
